import React from "react";
import { ArticleHelper } from "../components/ArticleHelper";
import "../styles/App.css";

export default function Templates() {
  const templates = [
    {
      title: "Statement of Work - SOW Template",
      subtitle: "A straight forward template used to help organize projects as a solo dev.",
      technologies: ["Markdown", "PDF Download"],
      links: {
        github: "No Links Here :)",
      },
      slug: "SOW Template",
      content: `This is a simple template for a Statement of Work (SOW) document, which can be used to outline the scope, objectives, and deliverables of a project. It is designed to be straightforward and easy to fill out, making it suitable for solo developers or small teams.`,
    },

  ];

  return (
    <main className="projects-page">
      <h1 style={{ fontSize: "2rem", marginBottom: "2rem" }}>Templates</h1>
      {templates.map((tmpl, idx) => (
        <div key={idx} className="project-entry" style={{ marginBottom: "2.5rem" }}>
          <ArticleHelper
            title={tmpl.title}
            subtitle={tmpl.subtitle}
            technologies={tmpl.technologies}
            links={tmpl.links}
	    slug={tmpl.slug}
          />
        </div>
      ))}
    </main>
  );
}
